.org/dc/terms','	This document is an up-to-date specification of all metadata terms maintained by the Dublin Core Metadata Initiative, including properties, vocabulary encoding schemes, syntax encoding schemes, and classes.','Examples of Agent include person, organization, and software agent.'),(9,'Metadata terms related to the DCMI Abstract Model','dcam','http://purl.org/dc/dcam','Metadata terms related to the DCMI Abstract Model','2012-06-14'),(10,'DCMI Type Vocabulary','dcmitype','http://purl.org/dc/dcmitype','DCMI Type Vocabulary','2012-06-14'),(11,'Vocabulário Controlado do Governo Eletrônico','vcge','http://vocab.e.gov.br/2011/03/vcge','http://vocab.e.gov.br/2011/03/vcge','2013-03');
